// setInterval을 사용해 일정 주기로 좌석 상태 확인
const intervalId = setInterval(() => {
    let hasSeatAvailable = false; // 좌석 여부를 추적

    initData.grades.forEach(grade => {
        console.log(`좌석 이름: ${grade.name}`);
        console.log(`남은 좌석 수: ${grade.remainCnt}`);
        
        if (grade.remainCnt > 0) {
            hasSeatAvailable = true; // 남은 좌석이 있으면 플래그를 true로 설정
        }
    });

    if (hasSeatAvailable) {
        playMusic();
        console.log("남은 좌석이 있습니다. 새로고침을 중단합니다.");
        clearInterval(intervalId); // 남은 좌석이 있으면 반복 중단
    } else {
        console.log("남은 좌석이 없습니다. 새로고침 버튼을 클릭합니다.");
        const refreshButton = document.querySelector('.btn_refresh');
        if (refreshButton) {
            refreshButton.click();
        }
    }
}, 1500); // 1.5초마다 확인

// 음악 파일 실행 함수 (예시로 오디오 파일 실행)
function playMusic() {
    var audio = new Audio('data:audio/wav;base64,');
    audio.play();
}